import React from 'react';
import './componentStyles.scss';


const Show = (props) => {
    return <div className="showDiv">
        <div className="showName">
            <h1>{props.name}</h1>
        </div>

        <div className="showDetails">
            <h4>two</h4>
            <h4>three</h4>
        </div>



    </div>
}


export default Show;
